【サイズ】約Ｈ９５×Ｗ１４０×Ｄ２０ｍｍ<br>  
【素材】<br>
表地：シルク１００％<br>
裏地：レーヨン１００％<br>
日本製<br><br>

伝統工芸・西陣織を持ちやすい小物に仕立てられています。<br>
根付などが付けられる輪カン付きのがま口小銭入れです。<br> 
カードが入るサイズです。<br>
イヤホンやちょこっとした小物入れとしても、いかがでしょう。<br><br>

【ご確認事項】<br>
※曲がり具合やサイズに若干の違いが生じる場合があります。<br>
※加工段階での多少の汚れ・スレ・色ムラ・ホツレ・折り曲げ加工の微細なズレ・歪みがある場合もございます。<br>
メーカーより“良品”として販売されております。ご理解頂きご注文をお願い致します。<br><br>
<hr><br>
※イメージ写真の商品はセット品ではありません。<br>
※実際のお色と多少異なる事があります。<br><br>
区分：ネコ　黒ねこ　猫雑貨　ネコグッズ　キャット　cat
<br><br>
池田あきこ　わちふぃーるど　WACHIFIELD<br><br>

広告文責：株式会社モリキ<br>電話：0269-38-0611<br><style type="text/css">
